import './App.css';
import React from 'react';

function App() {
  return (
    <html>
      <head>
        <script src="https://kit.fontawesome.com/d1b1f6e6ef.js" crossorigin="anonymous"></script>
      </head>
      <div className="App">
        <header className="App-header">
          <div class="dropdown">
            <i class="fa-solid fa-plus-large"></i>
          </div>
        </header>
        <body className="App-header">
        </body>
      </div>
    </html>
  );
}

export default App;
